import React from 'react';
import './App.css';
import { BrowserRouter as Router,Routers,Route,Link } from 'react-router-dom';
import { render } from '@testing-library/react';
import UserLogin from './UserLogin';


class App extends React.Component{
constructor(){
  super()
  this.state={
    name: "",
    email : "",
    pswd : "",
    cpswd : ""
  }
}

updateName=(x)=>{
  this.setState({
    name : x.target.value 
  })
}
  updateEmail=(x)=>{
    this.setState({
      email : x.target.value
    })
  }
  updatePswd=(x)=>{
    this.setState({
      pswd : x.target.value
    })
  }
  updateCpswd=(x)=>{
    this.setState({
      cpswd : x.target.value
    })
  }

check =(e)=>{
  e.preventDefault()
  if(this.state.name.length <= 5){
    alert("Name should be atleast 6 character")
  }
  else if (this.state.pswd != this.state.cpswd){
    alert("Password dosen't match")
  }
  else {
    alert("Register Successfully")
    this.dataStorage()
  }
}

dataStorage=()=>{

  localStorage.setItem("name",this.state.name)
  localStorage.setItem("email",this.state.email)
  localStorage.setItem("passsword",this.state.pswd)
}
  render(){
  return (
    <div className="App">
      <Router>    
        <form onSubmit={this.check}>
      <label>Name : </label>
      <input type='text' value={this.state.name} onChange={this.updateName} required></input>
      <br/><br/>
      <label>Email : </label>
      <input type='emial' value={this.state.email }onChange={this.updateEmail} required></input>
      <br/><br/>
      <label>Password : </label>
      <input type='password'value={this.state.pswd} onChange={this.updatePswd} required></input>
      <br/><br/>
      <label>Confrom Password : </label>
      <input type='password' value={this.state.cpswd} onChange={this.updateCpswd} required></input>
      <br/><br/>
      <Link>
      <input type='submit' value='Regiser'></input></Link>
    </form>

    <Routers>
    <Route path='/UserLogin' element={< UserLogin/>} />

    </Routers>

    </Router>

    </div>
  );
  }
}

export default App;
